import React from 'react';
import {aidos} from '../overview/aidos.png'
import 'bootstrap/dist/css/bootstrap.css';
import './index.css'


function IdeasComponent() {
    return (
        <div>
            <h4 className='center4'>Webinars </h4>
            <p>The Engineering Design Process and the Engineering Notebook. In this webinar, we will discuss the steps of the engineering design process and what is required to succeed at each step. Then, we will discuss the characteristics of good engineering notebooks and processes for creating them.  <a href="https://drive.google.com/file/d/1Z5eOIsoqD03XUp2pjd7DhD2lnFufzMRO/view?usp=sharing">View Recording</a></p>
            <p>Outreach and Service Opportunities.
            In this webinar, we will discuss how to develop and structure outreach specifically for your team, the logistics of professional outreach, and how to effectively present outreach.  <a href="https://drive.google.com/file/d/1z-NkqRn0-5hOxhmPHoRi7L9lil3pnwuz/view?usp=sharing">View Recording</a></p>



        </div>
    );
}

export default IdeasComponent;
